namespace App\Console\Commands\System;

use App\Models\System\Transaction;
use App\Models\PaymentOrder\PaymentOrder;
use App\Models\System\ScheduleLog;
use App\Models\TransportOrder\TransportCode;
use Illuminate\Console\Command;

class DeleteNullItemPaymentOrder extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'delete:null-payment-order';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Command description';

    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct()
    {
        parent::__construct();
    }

    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public function handle()
    {
        ini_set('memory_limit', '6400M');

        $orders = PaymentOrder::whereStatus('payment_not_export')
                ->with('transportCode')
                ->get();

        echo $orders->count() . "\n";

        $ids = [];
        foreach ($orders as $order) {
            $flag = $order->transportCode->count();

            if ($flag == 0 ) {
                $ids[] = $order->id;
            }
        }

        PaymentOrder::whereIn('id', $ids)->update([
            'status'    =>  'cancel',
            'note_command'  =>  'Chuyển từ payment_not_export về cancel do không có item'
        ]);

        ScheduleLog::create([
            'name'  =>  $this->signature . "- " . sizeof($ids)
        ]);

    }
}

